/*
活动名称：批量店铺签到 · 超级无线/超级会员（积分签到专用）
活动链接：https://lzkj-isv.isvjd.com/sign/signActivity2?activityId=<活动id>
        https://lzkj-isv.isvjd.com/sign/sevenDay/signActivity?activityId=<活动id>
        https://cjhy-isv.isvjcloud.com/sign/signActivity?activityId=<活动id>
        https://cjhy-isv.isvjcloud.com/sign/sevenDay/signActivity?activityId=<活动id>
环境变量：jd_wxSignPoint_sign_lzkj_Ids // 超级无线签到有礼活动id，多个用英文逗号分割
        jd_wxSignPoint_sevenDay_lzkj_Ids // 超级无线7日签到活动id，多个用英文逗号分割
        jd_wxSignPoint_sign_cjhy_Ids // 超级会员签到有礼活动id，多个用英文逗号分割
        jd_wxSignPoint_sevenDay_cjhy_Ids // 超级会员7日签到活动id，多个用英文逗号分割
        jd_wxSignPoint_lzkjInterval // 自定义超级无线活动签到间隔时长（整数，单位毫秒），默认500ms
        jd_wxSignPoint_cjhyInterval // 自定义超级会员活动签到间隔时长（整数，单位毫秒），默认1000ms
        jd_wxSignPoint_lzkjFilter // 账号pin过滤（跳过不跑），多个用户名用@分割
        jd_wxSignPoint_cjhyFilter // 账号pin过滤（跳过不跑），多个用户名用@分割
        jd_wxSignPoint_notify // 是否推送通知（true/false），默认不推送
        jd_wxSignPoint_maxRetry // 签到失败时的最大重试次数（整数），默认0
        jd_wxSignPoint_forbiddenQuit // 当连续请求IP被限制时是否跳出即停止运行脚本（true/false），默认停止运行

不同环境变量对应不同链接类型注意区分，官方接口垃圾，中奖一切随缘，打印仅供参考
脚本不判断黑号（响应擦肩），请主动设置过滤
此脚本与 jd_wxSign.js 功能完全一致只是变量不同，推出此本的目的是为了满足需要将积分签到活动分开跑的需求

cron: 7 7 7 7 * jd_wxSignPoint.js

*/

